  true,\n\t\"url\": null,\n\t\"notes\": \"<p>The payroll data represents the amount
  paid to an employee during the reported time period. In addition to regular pay,
  these amounts may include other pay types such as overtime, longevity, shift differential
  or terminal pay. This amount does not include any state share costs associated with
  the payroll i.e. FICA, state share retirement, etc. This amount may vary from an
  employeeu2019s u2018salaryu2019 due to pay adjustments or pay period timing. The
  payroll information will be updated monthly after the end of the month. For example,
  July information will be added in August.</p>n\",\n\t\"license_title\": \"Other
